For this example, assume that there are 50 teams, all with 0 points, each with a name of debug[number], and there are 2 challenges, each valued at 50 points. To get the top 100 teams, use the following request: GET /api/scoreboard/0 As there are only 50 teams, only 50 will be returned: { "success": true, "totalTeams": 50, "maxPoints": 100, "teams": [ { "name": "debug0", "points": 0 }, { "name": "debug1", "points": 0 }, // ... // { "name": "debug49", "points": 0 } ]
} To get the top 100 teams starting with index 15 (i.e. teams from 16th place to 50th place), use the following request: GET /api/scoreboard/15 As there are only 35 teams left (50 - 15), only those teams will be returned: { "success": true, "totalTeams": 35, "maxPoints": 100, "teams": [ { "name": "debug15", "points": 0 }, { "name": "debug16", "points": 0 }, // ... // { "name": "debug49", "points": 0 } ]
}

